package com.zaritcare.data.mocks.song

import com.zaritcare.R
import javax.inject.Inject

class SongDaoMock @Inject constructor() {
    private val sunriseImage: String = ""
    private val relaxingImage: String = ""
    private val relaxingTimeImage: String = ""
    private val valleyImage: String = ""

    private val songs: MutableList<SongMock> = mutableListOf(
        SongMock(
            id = 1,
            image = sunriseImage,
            audio = R.raw.healing_sounds_audio
        ),
        SongMock(
            id = 2,
            image = relaxingImage,
            audio = R.raw.relaxing_audio
        ),
        SongMock(
            id = 3,
            image = relaxingTimeImage,
            audio = R.raw.relaxing_time_audio
        ),
        SongMock(
            id = 4,
            image = valleyImage,
            audio = R.raw.valley_silence_audio
        )
    )

    fun get(): List<SongMock> = songs
    fun get(id: Int): SongMock? = songs.find { it.id == id }
    fun insert(song: SongMock) = songs.add(song)
    fun count(): Int = songs.size
}